measurements.description:
One symmetrical flower on one 23.2-cm inflorescence;
	arising from a 3-growth 21.5-cm plant;
	sepals white overlaid green centrally, rose suffused marginally, venation green;
	petals white, basally green, distally rose, veining cordovan, random deep mahogany raised spots, superior margins hirsute;
	pouch maroon, veining darker maroon;
	staminode light green, dark green centrally;
	substance firm; texture glossy.
